contracts/EnumDemo.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >0.8.0;

// 枚举
contract EnumDemo {
    enum State {
        Off, // 0
        On // 1
    }

    State public state;

    function getState() public view returns(State) {
        return state;
    }

    function setState(State _state) public {
        state = _state;
    }

    function on() public {
        state = State.On;
    }

    function off() public {
        state = State.Off;
    }

    function reset() public {
        delete state;
    }
}

